import React from "react";
//import ListMahasiswa from "../components/content/mahasiswa/page"
import Listmuser from "../components/content/m_user/list_m_user"
// import listmahasiswa from "../components/content/mahasiswa/listmahasiswa";
// //import user from "./user";
 import Page from "../components/content/mahasiswa/page"

// import ddd from "../components/content/controlbox/dependentdropdown"

class sidebar extends React.Component {
 
  render() {
    return (
      <div class="container-fluid mt-5 ml-5">
      <div class="row">
          <div class="col-md-3">
              <div id="list-example" class="list-group">
                  <a class="list-group-item list-group-item-action" href="#list-item-1">Beranda</a>
                  <a class="list-group-item list-group-item-action" data-toggle="modal"
                      data-target="#pelamar">Pelamar</a>
                  <a class="list-group-item list-group-item-action" href="#list-item-3">Item 3</a>
                  <a class="list-group-item list-group-item-action" href="#list-item-4">Item 4</a>
              </div>
          </div>
          <div class="col-md-8" style={{background_color: "white"}}>
                
            </div>
           
      </div>
      </div>
  

    
    );
  }
}

export default sidebar;
